- input: "TEXT\x1CC00109991\x1C.TEXT\x1C\x1CF3XA\x1CIn reply to FEC letter from Mr.
    Edward Ryan dated April 8, 2009, we have investigated our filings and have determined
    that the disbursement made on 6/19/2007 to Committee to Re-Elect Nydia M. Velazquez
    in the amount of $1,500 was incorrectly reported as a contribution to the 2008
    General Election.  That contribution should have been reported as a disbursement
    to the 2008 Primary Election.  This amendment to our 2007 July Quarterly filing
    should correct this reporting error.  Thank you.\n"
